-- ----------------------------
-- Function structure for `GetChildIDs`
-- ----------------------------
DROP FUNCTION IF EXISTS `GetChildIDs`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `GetChildIDs`(rootID INT) RETURNS varchar(500) CHARSET utf8
BEGIN
	DECLARE childids VARCHAR(500);
	DECLARE tempids VARCHAR(500);
	SET childids = '$';
	SET tempids = CAST(rootID AS CHAR);
	WHILE tempids is NOT NULL DO
		SET childids = CONCAT(childids,',',tempids);
		SELECT GROUP_CONCAT(category.category_id) INTO tempids FROM category WHERE FIND_IN_SET(category.category_father_id,tempids);
	END WHILE;
	RETURN childids;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `GetFatherIDs`
-- ----------------------------
DROP FUNCTION IF EXISTS `GetFatherIDs`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `GetFatherIDs`(childID INT) RETURNS varchar(1000) CHARSET utf8
BEGIN
	DECLARE fatherIDs VARCHAR(1000);
	SET fatherIDs = '$';
	WHILE ((childID != 1) AND (childID>0)) DO
		SET fatherIDs = CONCAT(fatherIDs,',',childID);
		SELECT category.category_father_id INTO childID FROM category WHERE category.category_id = childID;
	END WHILE;
	SET fatherIDs = CONCAT(fatherIDs,',',1);
RETURN fatherIDs;
END
;;
DELIMITER ;
