nt-size: 12px; text-align: center;\"><span style=\"font-size: 18px;\"><strong><span style=\"font-family: arial, helvetica, sans-serif;\">999OWN.RU — оптовый интернет-магазин нового поколения!</span></strong></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; list-style: none; border: 0px; color: rgb(62, 62, 62); font-family: &#39;Microsoft YaHei&#39;; font-size: 12px;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\">&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; list-style: none; border: 0px; color: rgb(62, 62, 62); font-family: &#39;Microsoft YaHei&#39;; font-size: 12px;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\"></span></p><p style=\"white-space: normal; text-align: center;\"><br/></p><p style=\"white-space: normal;\"><strong><span style=\"font-family: Arial; color: rgb(56, 56, 56); letter-spacing: 0px; font-size: 15px; background: rgb(255, 255, 255);\">&nbsp;</span></strong></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">999OWN.</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">RU</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">– самый быстрорастущий оптовый интернет-магазин&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">в</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;России и&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">других странах</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">.</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">Мы предлагаем самый широкий ассортимент обуви,</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;сумок</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">. Мы регулярно пополняем ассортимент новыми категориями товаров и подключаем к сотрудничеству новых производителей.</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;Мы предлагаем самый актуальный сезонный товар для наших клиентов что позволяет&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">удовлетворить потребности&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">наших клиентов.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">Мы даем нашим клиентам доступ к сотне&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">китайски</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">х производителей на одном сайте, что существенно увеличивает выбор и экономит время и деньги наших клиентов. Вам не нужно переплачивать за доставку, делая заказы у разных поставщиков на разных сайтах, мы уже собрали все для вас на</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">999OWN.</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">RU!&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">Главн</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">о, что н</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">а нашем портале представлен подробный&nbsp;</span><a href=\"http://www.qifa.ru/catalog\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">каталог всего имеющегося ассортимента обуви</span></a><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">и сумок&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">с ценами, где&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">наш</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">клиент</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;сможет найти интересующую модель.</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">Даже если наши клиенты не могут найти сво</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">ю&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">любим</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">ую модель</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">,&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">то&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">наши сотрудники всегда готовы проконсультировать Вас относительно интересующей модели.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial; font-size: 14px;\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">Мы работаем без посредников со всеми производителями, поэтому можем предложить вам самые низкие цены на рынке.&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">У нас представлены самые низкие цены на обувь&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">и сумку&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">оптом, тем самым Вы экономите деньги, увеличиваете прибыль и повышаете рентабельность своего бизнеса. &nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px; background: rgb(255, 255, 255);\">&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; text-align: justify; background: rgb(255, 255, 255);\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">Все товары перед отправкой клиентам проходят обязательную ручную проверку качества. Все категории товаров на платформе предлагаются оптом,&nbsp;</span><span style=\"font-family: Arial; color: rgb(255, 0, 0); letter-spacing: 0px; font-size: 13px;\">поштучно</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">&nbsp;или&nbsp;</span><span style=\"font-family: Arial; color: rgb(255, 0, 0); letter-spacing: 0px; font-size: 13px;\">сборными упаковками</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">&nbsp;по несколько штук.&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">Но до сих пор на нашем портале большинство товара продается оптом поштучно.&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">В одном заказе можно комбинировать как товары из разных категорий, так и товары, которые продаются оптом поштучно</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">&nbsp;и упаковками</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">. Главное - собрать заказ на минимальную сумму&nbsp;</span><span style=\"font-family: Arial; color: rgb(255, 0, 0); letter-spacing: 0px; font-size: 13px;\">2</span><span style=\"font-family: Arial; color: rgb(255, 0, 0); letter-spacing: 0px; font-size: 13px;\">0 000 рублей</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">. Чтобы посмотреть, какие товары продаются оптом упаковками, а какие поштучно, используйте фильтры на нашем сайте</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">, кроме того, на странице каждого товара четко написано “продается пошучно или упаковками”.&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">Если товар продается упаковками, то его можно купить только упаковками, и размерные ряды не разбиваются. Некоторые товары продаются сборными упаковками по несколько штук: в такую упаковку вы добавляете только нужные вам цвета, размеры или ростовку, в зависимости от того, что предлагает производитель.&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; text-align: justify; background: rgb(255, 255, 255);\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; text-align: justify; background: rgb(255, 255, 255);\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">Вы можете закупить оптом товары на нашей&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">платформе</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">, кроме того, вы еще можете сотрудничать с нами по&nbsp;дропшиппингу. Чтобы знать подробнее условия сотрудничества</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; text-align: justify; background: rgb(255, 255, 255);\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">п</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">о дропшиппингу,&nbsp;</span><span style=\"font-family: Arial; color: rgb(0, 176, 240); letter-spacing: 0px; font-size: 13px;\">нажмите.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; text-align: justify; background: rgb(255, 255, 255);\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">&nbsp;</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; text-align: justify; background: rgb(255, 255, 255);\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">Желаем вам удачную покупку!</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; text-align: justify; background: rgb(255, 255, 255);\"><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">Если у вас есть дополнительные вопросы, посмотрите &quot;вопрос-ответ&quot;, или свяжитесь с нами по почте&nbsp;</span><a href=\"mailto:info@999own.ru\"><span style=\"font-family: Ubuntu; color: rgb(0, 0, 255); letter-spacing: 0px; font-size: 13px;\">info@999own.ru</span></a><span style=\"font-family: Ubuntu; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">&nbsp;</span><span style=\"font-family: Arial; color: rgb(136, 136, 136); letter-spacing: 0px; font-size: 13px;\">или “оставить запрос” на нашем сайте.</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; list-style: none; border: 0px; color: rgb(62, 62, 62); font-family: &#39;Microsoft YaHei&#39;; font-size: 12px;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: 14px;\"></span><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; list-style: none; border: 0px; color: rgb(62, 62, 62); font-family: &#39;Microsoft YaHei&#39;; font-size: 12px;\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; white-space: normal; padding: 0px; list-style: none; border: 0px; color: rgb(62, 62, 62); font-family: &#39;Microsoft YaHei&#39;; font-size: 12px;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><br/></p><p><br/></p>', '', '', '', '2016-10-23 02:31:58', '2016-10-23 06:05:03');
