INSERT INTO `storefooterinfomultilanguage` VALUES ('147', '55', '7', 'Преимущества', '<p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\"><strong><span style=\"color: rgb(38, 38, 38); letter-spacing: 0px; background: rgb(255, 255, 255);\">К преимуществам оптового интернет-магазина&nbsp;</span></strong><strong><span style=\"color: rgb(38, 38, 38); letter-spacing: 0px; background: rgb(255, 255, 255);\">999OWN</span></strong><strong><span style=\"color: rgb(38, 38, 38); letter-spacing: 0px; background: rgb(255, 255, 255);\">.</span></strong><strong><span style=\"color: rgb(38, 38, 38); letter-spacing: 0px; background: rgb(255, 255, 255);\">RU</span></strong><strong><span style=\"color: rgb(38, 38, 38); letter-spacing: 0px; background: rgb(255, 255, 255);\">&nbsp;относятся:</span></strong></span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(38, 38, 38); letter-spacing: 0px; font-size: 14px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; background: rgb(255, 255, 255);\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">1) Огромный ассортимент</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">Количество производителей обуви и сумок на нашем сайте составляет более 100. Ежедневно мы обновляем примерно на 100 моделей – неповторимых и абсолютно новых. В каталоге представлена обувь и сумку для женщин, мужчин и детей из разных материалов.</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">2) Экономия времени</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial; letter-spacing: 0px; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">Совершая покупки в оптовом интернет–магазине&nbsp;999OWN.RU, вы значительно экономите свое время. Ведь вам не нужно искать обувь и сумку по всему интернету, вы можете воспользоваться нашим каталогом на сайте, сортировочной функцией или ввести название товара. В нашем интернет-магазине все намного проще и быстрее.</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial; letter-spacing: 0px; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">3) Выгодные цены<br/>Мы работаем без посредников со всеми производителями, поэтому можем предложить вам самые низкие цены на рынке. У нас Вы найдете широкий выбор товаров по доступным и демократичным ценам.</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">4) Высокое качество</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">Мы отбираем товары высокого качества. Кроме того, перед отгрузкой мы тщательно проверяем товары по заказу.</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">5) Полная информация о товаре</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">Смотря товары в нашем интернет-магазине вы можете быстро узнать самую подробную информацию о интересующем вас товаре и сделать выбор. Подробное описание есть на каждой странице товара.</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"letter-spacing: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">6) Оповещение об акций и распродажи</span></p><p style=\"white-space: normal;\"><span style=\"font-family: Arial; letter-spacing: 0px; font-size: 14px; color: rgb(127, 127, 127); background: rgb(255, 255, 255);\">Мы отправляем Вам акции со скидками на электронную почту, которую вы указываете при оформлении заказа в нашем интернет-магазине&nbsp;999OWN.RU. Вы будете в курсе всех наших акций и распродаж!</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127);\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(127, 127, 127);\"><br/></span></p><p><br/></p>', '', '', '', '2016-10-23 02:35:57', '2016-10-23 06:39:38');
