INSERT INTO `storefooterinfomultilanguage` VALUES ('157', '56', '7', 'Политика кофиденциальности', '<p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">1. Просмотром и использованием веб-сайта&nbsp;<a href=\"http://www.999own.ru/\" target=\"_blank\"><span style=\"color: rgb(227, 108, 9);\">www.999own.ru</span></a>&nbsp;(&quot;Сайт&quot;) и/или путем покупки любых продуктов, доступных через Сайт Вы (&quot;Вы&quot; или &quot;Ваш&quot;) подтверждаете, что ознакомились с Политикой Конфиденциальности и согласны со всеми её условиями. Если Вы не согласны со всеми условиями настоящей Политики Конфиденциальности, вашим единственным эксклюзивным правом является прекращение пользования Сайтом.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">2. ООО &quot;999OWN&quot; (&quot;999OWN&quot;, &quot;Нами&quot;, &quot;Мы&quot; или &quot;Наши&quot;) уважает конфиденциальность посетителей Сайта. Настоящая Политика Конфиденциальности 999OWN между Вами и Нами (&quot;Политика Конфиденциальности&quot;) предназначена для информирования Вас о Нашей политике и методах работы, относящихся к сбору, использованию и разглашению любой Личной и Анонимной Информации, которую Мы получаем от Вас с помощью Сайта либо посредством Приложения.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">3. &quot;Личная Информация&quot; включает в себя следующие данные о Вас: Ваше имя, адрес эл. почты, телефонный номер, платежная информация и информация о счете, а также прочая закрытая информация. &quot;Анонимная Информация&quot; включает в себя информацию, не связанную с Вашей Личной Информацией. Анонимная Информация не позволяет идентифицировать отдельных лиц.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">4. Согласие Пользователя</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">4.1. Передавая Вашу Личную Информацию через Сайт либо Приложение вы соглашаетесь с условиями настоящей Политики Конфиденциальности и даете свое согласие на обработку Вашей Личной Информации в соответствии с настоящей Политикой Конфиденциальности. Ваша Личная Информация может быть обработана Нами в стране, где она была собрана, а также в других странах, где законы об обработке Личной Информации могут быть менее строгими, чем законы вашей страны.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">5. Сбор Личной Информации</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">5.1. Ваша Личная Информация, собранная Нами, помогает узнать больше о посетителях Сайта, Наших текущих и потенциальных клиентах. Мы используем данную информацию для улучшения и поддержки Наших продуктов и услуг, для предоставления Вам дополнительной информации и возможностей, а также для уведомления об изменениях в настоящей Политике Конфиденциальности (а также Пользовательском соглашении).</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6. Личная Информация, предоставляемая Нам Вами</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.1. Мы собираем Личную Информацию, которую вы добровольно передаете Нам через Сайт.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.2. Если Вы приобретаете продукт через Сайт, то Мы собираем следующую информацию, которую Вы предоставляете Нам: Ваше имя и фамилию, адрес электронной почты, почтовый адрес и юридический адрес, если он отличается от вашего почтового адреса, расчетный счет и банковские реквизиты.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.3. Когда Вы связываетесь с Нами по электронной почте, Мы собираем такие данные, как Ваше имя, адрес электронной почты и информацию, содержащуюся в Вашем электронном письме.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.4. Когда Вы участвуете в Нашем опросе пользователей, Мы обрабатываем такие данные, как Ваше имя и адрес электронной почты.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.5. Если Вы захотите получать от Нас информацию об обновлениях продуктов, Мы обрабатываем Ваше имя и адрес электронной почты.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.6. Личная Информация, собранная Техническими Средствами</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.7. Во время Вашей работы с Сайтом некоторая информация может быть собрана в пассивном режиме, включая ваш IP-адрес (&quot;IP-адрес&quot;), тип браузера, имена доменов, время посещения и операционную систему. Мы также используем &quot;Куки&quot; и навигационные данные наподобие Единого Указателя Ресурсов (URL) для сбора данных о дате и времени Вашего визита, а также информации, которую Вы искали и просматривали. Подобная информация собирается для того, чтобы сделать Наши продукты и услуги еще более полезными для Вас. В некоторых Наших сообщениях по электронной почте мы используем &quot;URL с переходом по баннерам&quot; для того, чтобы сделать Наш Сайт максимально удобным для Вас. Когда Вы нажимаете на одну из таких ссылок, Вы проходите через Наш веб-сервер перед тем, как попасть на нужный веб-сайт. Мониторинг переходов по баннерам помогает Нам понять Вашу заинтересованность в конкретных продуктах и оценить эффективность Нашей связи с покупателями.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.8. &quot;IP-адрес&quot; – это номер, автоматически присваиваемый Вашему компьютеру, когда Вы выходите в Интернет. В некоторых случаях Ваш IP-адрес остается неизменным от одной сессии браузера к другой, но если Вы используете Интернет-провайдер, то Ваш IP-адрес, скорее всего, меняется от сессии к сессии. Мы отслеживаем IP-адреса только совместно с куки сессий в целях анализа трафика на Нашем Сайте.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.9. &quot;Куки&quot; сохраняют информацию, которую веб-сайт посылает на жесткий диск Вашего компьютера во время его просмотра. Мы можем использовать как временные куки (которые удаляются сразу после закрытия браузера), так и постоянные куки (которые остаются на Вашем компьютере, пока вы их не удалите), чтобы сделать информацию нашего Сайта персонализированной. Постоянные куки могут быть удалены. Чтобы сделать это, следуйте инструкциям, указанным в файле помощи вашего браузера. Если Вы отключите куки, то некоторые функции Сайта могут работать некорректно.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.10. Личная Информация, получаемая Нами из других источников</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">6.11. Мы можем получать Вашу Личную Информацию из других источников, таких как почта; сообщения, отправленные Вами при помощи Сайта; телефона; факса. Мы можем использовать эти данные наряду с информацией, которую Мы уже собрали о Вас через Сайт, чтобы улучшить качество предоставляемых Нами продуктов и Услуг.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">7. Использование Информации</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">7.1. Если Вы подписались на Нашу электронную рассылку, то переданная Вами Личная Информация будет использована для ответа на Ваши запросы, отправки Вам пресс-релизов, информационных объявлений общего характера и другой информации о Нас или Наших продуктах, а также с целью улучшения качества предоставляемых Нами услуг. Наши покупатели могут отказаться от получения информации об обновлениях продуктов в любое время. Вы сможете отказаться от Наших рассылок в нижней части каждого электронного письма, которое Мы отправим Вам.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">7.2. Если Вы не давали согласие на получение Наших рассылок, то Мы не будем с Вами связываться, за исключением случаев, когда по какой-либо причине Мы не сможем обработать заказ, который Вы разместили через Сайт. В подобных случаях Мы можем связаться с Вами, чтобы запросить дополнительную информацию или уточнить уже имеющиеся данные для завершения обработки Вашего заказа.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">7.3. В процессе предоставления Наших услуг Мы можем раскрыть Вашу Личную Информацию сторонним поставщикам. Мы также можем использовать Вашу Личную Информацию, чтобы информировать Вас об изменениях и обновлениях Сайта, в случае если вы не отказались от подобных рассылок.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">7.4. Мы может создавать записи Анонимной Информации из Личной Информации, исключив данные (например, Ваше имя) – вариант обобщённая статистика, которые являются устанавливающими Вашу личность. Мы можем использовать данную Анонимную Информация для анализа структуры запросов и использования наших продуктов, чтобы улучшить качество наших продуктов и услуг. Мы оставляем за собой право использовать и раскрывать Анонимную Информацию третьей стороне по Нашему усмотрению, в том числе для внутреннего бизнес-анализа и предоставления совокупных демографических данных Нашим партнерам.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">8. Личная Информация, собранная в процессе совершения заказов</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">8.1. Если вы приобрели какие-либо продукты через Наш Сайт, то на Вас может распространяться действие дополнительных положений и условий продажи и/или лицензий, в рамках которых Вы имеете право использовать любое программное обеспечение, встроенные в подобные продукты, если таковое имеется. Эти дополнительные положения и условия регулируют Ваши права на подобные продукты и в отношении оных.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">9. Отзывы</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">9.1. Если Вы оставляете отзывы на Сайте, то Мы можем использовать их в любых целях, при условии, что Мы не будем ассоциировать отзыв с Вашей Личной Информацией. Мы будем собирать любую информацию, содержащуюся в подобных сообщениях и использовать Личную Информацию, содержащуюся в подобных сообщениях, в соответствии с настоящей Политикой Конфиденциальности.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">10. Раскрытие Личной Информации</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">10.1. За исключением случаев, предусмотренных Политикой Конфиденциальности, Мы не раскрываем Вашу Личную Информацию третьим лицам. Мы также не раскрываем информацию о счетах без Вашего ведома.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">10.2. Однако Мы можем сообщить Вашу Личную Информацию третьим лицам для обработки платежей или для того, чтобы предоставить Вам доступ на Сайт. Данные лица обязуются не использовать Вашу Личную Информацию в целях, отличных от предоставления запрошенных нами услуг, и связаны соглашениями о неразглашении конфиденциальной информации. Вы даете свое согласие на передачу Вашей Личной Информации Нашим подрядчикам и сторонним поставщикам для предоставления Вам наших продуктов и услуг.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">10.3. В будущем у нас могут появиться компания-учредитель, дочерние предприятия, совместные предприятия и другие связанные с Нами компании (было: компании под общим с нами управлением) (все вместе – &quot;Связанные Структуры&quot;). На данный момент Мы не раскрываем Вашу Личную Информацию Нашим Связанным Структурам, но если в будущем Мы раскроем Вашу Личную Информацию (частично или полностью) данным Связанным Структурам, то Мы обеспечим соблюдение ими настоящей Политики Конфиденциальности.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">10.4. Если Наша компания или Наши активы приобретет другая компания, она становится владельцем собранной Нами Личной Информации и принимает на себя права и обязательства в отношении Вашей Личной Информации, описанные в настоящей Политике Конфиденциальности.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">10.5. Вне зависимости от выбора, который Вы сделаете в отношении Вашей Личной Информации (как описано далее), Мы можем раскрыть Вашу Личную Информацию (1) если посчитаем, что подобное раскрытие необходимо для (а) соблюдения соответствующих законов или ответа на постановления суда, или (б) для защиты Наших или сторонних прав или собственности; или (2) в связи с расследованием и предотвращением мошенничества.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">11. Ваш выбор в отношении использования Вашей Личной Информации</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">11.1. Мы предлагаем Вам выбор в отношении сбора, использования и передачи Вашей Личной Информации. У Вас будет возможность отказаться от Нашей рекламной рассылки, когда Вы будете приобретать продукты через Сайт и/или Приложение. Вы можете отказаться от нашей дальнейшей рассылки, а также получите возможность &quot;отказаться&quot;, следуя инструкциям по отмене подписки, содержащимся в полученном Вами электронном письме, или предоставляемых Нами путем прямого контакта (см. контактную информацию далее). Вне зависимости от Ваших предпочтений в отношении электронной почты, Мы может посылать Вам уведомления об обновлении Нашей Политики Безопасности.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">12. В отношении детей</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">12.1. Мы не занимаемся целенаправленным сбором Личной Информации о посетителях, не достигших 13-летнего возраста.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">13. Другие сайты</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">13.1. Ссылки на любой другой веб-сайт или страницу предоставляются Нами исключительно для Вашего удобства и не служат показателем нашей поддержки другого веб-сайта, страницы или ее содержания. Мы не контролируем, не проверяем и не несем ответственность за эти веб-сайты и их содержание. Пожалуйста, помните, что условия Нашей Политики Конфиденциальности неприменимы к сторонним веб-сайтам.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">14. Безопасность</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">14.1. Мы прилагаем коммерчески оправданные усилия для защиты Вашей Личной Информации, используя технологии и методы обеспечения безопасности, отвечающие современным стандартам индустрии, чтобы помочь сохранить Вашу Личную Информацию от несанкционированного доступа, использования или раскрытия. Мы обеспечиваем безопасность данных, которые Вы посылаете Нам физическими и электронными процессами и процессами управления. Мы настоятельно рекомендуем Вам соблюдать все меры предосторожности для защиты Вашей Личной Информации во время работы в Интернете. Одним из возможных способов защиты - использование безопасного браузера. Наш коммерческий сайт использует SSL-шифрование, отвечающее современным стандартам индустрии, на всех коммерческих веб-страницах, где используется Ваша Личная Информация. В качестве дополнительной меры предосторожности, убедитесь, что Вы используете последнюю версию браузера с поддержкой SSL. Мы рекомендуем использовать Internet Explorer 9, Chrome 11, Firefox 6, Opera 15, Android 4, Safari 5.1.4. Это поможет лучше защитить конфиденциальность Вашей Личной Информации во время работы в Интернете.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">14.2. За исключением особых случаев, предусмотренных настоящей Политикой Безопасности, Мы предоставляем доступ к Личной Информации, хранящейся в наших электронных базах, только представителям Нашей организации (включая сотрудников и подрядчиков), которым он требуется для выполнения рабочих обязанностей.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">14.3. Мы принимаем все возможные меры, чтобы защитить Вашу Личную информацию от перехвата, доступа, использования или раскрытия несанкционированными лицами, однако Мы не можем полностью исключить все угрозы, связанные с безопасностью Вашей Личной Информацией.</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">15. Обновления Политики Конфиденциальности</p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\">15.1. Настоящая Политика Конфиденциальности может подвергнуться изменениям в любой момент по Нашему единоличному усмотрению. Мы оповестим Вас об изменениях в настоящей Политике Конфиденциальности по предоставленному Вами адресу электронной почты, а также разместим любые изменения Политики Конфиденциальности на Сайте. Тем не менее, мы рекомендуем Вам перечитывать настоящую Политику Безопасности каждый раз, когда вы используете Наш веб-сайт на тот случай, если вы пропустили изменения в Политике Безопасности. Если Вы не согласны с какими-либо изменениями, Вы должны немедленно прекратить использование Сайта и/или Приложения. Использование Сайта после оповещения о любых подобных изменениях будет воспринято как принятие Вами подобных изменений и согласие со всеми положениями и условиями подобных изменений.</p><p><br/></p>', '', '', '', '2016-10-23 02:38:04', '2016-10-23 06:50:52');
INSERT INTO `storefooterinfomultilanguage` VALUES ('158', '56', '8', 'Политика кофиденциальности', '<p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">1. Просмотром и использованием веб-сайта&nbsp;</span><a href=\"http://www.999own.ru/\" target=\"_blank\" style=\"text-decoration: underline; color: rgb(227, 108, 9); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><span style=\"color: rgb(227, 108, 9); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">www.999own.ru</span></a><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;(&quot;Сайт&quot;) и/или путем покупки любых продуктов, доступных через Сайт Вы (&quot;Вы&quot; или &quot;Ваш&quot;) подтверждаете, что ознакомились с Политикой Конфиденциальности и согласны со всеми её условиями. Если Вы не согласны со всеми условиями настоящей Политики Конфиденциальности, вашим единственным эксклюзивным правом является прекращение пользования Сайтом.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">2. ООО &quot;999OWN&quot; (&quot;999OWN&quot;, &quot;Нами&quot;, &quot;Мы&quot; или &quot;Наши&quot;) уважает конфиденциальность посетителей Сайта. Настоящая Политика Конфиденциальности 999OWN между Вами и Нами (&quot;Политика Конфиденциальности&quot;) предназначена для информирования Вас о Нашей политике и методах работы, относящихся к сбору, использованию и разглашению любой Личной и Анонимной Информации, которую Мы получаем от Вас с помощью Сайта либо посредством Приложения.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">3. &quot;Личная Информация&quot; включает в себя следующие данные о Вас: Ваше имя, адрес эл. почты, телефонный номер, платежная информация и информация о счете, а также прочая закрытая информация. &quot;Анонимная Информация&quot; включает в себя информацию, не связанную с Вашей Личной Информацией. Анонимная Информация не позволяет идентифицировать отдельных лиц.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4. Согласие Пользователя</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4.1. Передавая Вашу Личную Информацию через Сайт либо Приложение вы соглашаетесь с условиями настоящей Политики Конфиденциальности и даете свое согласие на обработку Вашей Личной Информации в соответствии с настоящей Политикой Конфиденциальности. Ваша Личная Информация может быть обработана Нами в стране, где она была собрана, а также в других странах, где законы об обработке Личной Информации могут быть менее строгими, чем законы вашей страны.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">5. Сбор Личной Информации</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">5.1. Ваша Личная Информация, собранная Нами, помогает узнать больше о посетителях Сайта, Наших текущих и потенциальных клиентах. Мы используем данную информацию для улучшения и поддержки Наших продуктов и услуг, для предоставления Вам дополнительной информации и возможностей, а также для уведомления об изменениях в настоящей Политике Конфиденциальности (а также Пользовательском соглашении).</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6. Личная Информация, предоставляемая Нам Вами</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.1. Мы собираем Личную Информацию, которую вы добровольно передаете Нам через Сайт.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.2. Если Вы приобретаете продукт через Сайт, то Мы собираем следующую информацию, которую Вы предоставляете Нам: Ваше имя и фамилию, адрес электронной почты, почтовый адрес и юридический адрес, если он отличается от вашего почтового адреса, расчетный счет и банковские реквизиты.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.3. Когда Вы связываетесь с Нами по электронной почте, Мы собираем такие данные, как Ваше имя, адрес электронной почты и информацию, содержащуюся в Вашем электронном письме.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.4. Когда Вы участвуете в Нашем опросе пользователей, Мы обрабатываем такие данные, как Ваше имя и адрес электронной почты.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.5. Если Вы захотите получать от Нас информацию об обновлениях продуктов, Мы обрабатываем Ваше имя и адрес электронной почты.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.6. Личная Информация, собранная Техническими Средствами</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.7. Во время Вашей работы с Сайтом некоторая информация может быть собрана в пассивном режиме, включая ваш IP-адрес (&quot;IP-адрес&quot;), тип браузера, имена доменов, время посещения и операционную систему. Мы также используем &quot;Куки&quot; и навигационные данные наподобие Единого Указателя Ресурсов (URL) для сбора данных о дате и времени Вашего визита, а также информации, которую Вы искали и просматривали. Подобная информация собирается для того, чтобы сделать Наши продукты и услуги еще более полезными для Вас. В некоторых Наших сообщениях по электронной почте мы используем &quot;URL с переходом по баннерам&quot; для того, чтобы сделать Наш Сайт максимально удобным для Вас. Когда Вы нажимаете на одну из таких ссылок, Вы проходите через Наш веб-сервер перед тем, как попасть на нужный веб-сайт. Мониторинг переходов по баннерам помогает Нам понять Вашу заинтересованность в конкретных продуктах и оценить эффективность Нашей связи с покупателями.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.8. &quot;IP-адрес&quot; – это номер, автоматически присваиваемый Вашему компьютеру, когда Вы выходите в Интернет. В некоторых случаях Ваш IP-адрес остается неизменным от одной сессии браузера к другой, но если Вы используете Интернет-провайдер, то Ваш IP-адрес, скорее всего, меняется от сессии к сессии. Мы отслеживаем IP-адреса только совместно с куки сессий в целях анализа трафика на Нашем Сайте.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.9. &quot;Куки&quot; сохраняют информацию, которую веб-сайт посылает на жесткий диск Вашего компьютера во время его просмотра. Мы можем использовать как временные куки (которые удаляются сразу после закрытия браузера), так и постоянные куки (которые остаются на Вашем компьютере, пока вы их не удалите), чтобы сделать информацию нашего Сайта персонализированной. Постоянные куки могут быть удалены. Чтобы сделать это, следуйте инструкциям, указанным в файле помощи вашего браузера. Если Вы отключите куки, то некоторые функции Сайта могут работать некорректно.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.10. Личная Информация, получаемая Нами из других источников</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6.11. Мы можем получать Вашу Личную Информацию из других источников, таких как почта; сообщения, отправленные Вами при помощи Сайта; телефона; факса. Мы можем использовать эти данные наряду с информацией, которую Мы уже собрали о Вас через Сайт, чтобы улучшить качество предоставляемых Нами продуктов и Услуг.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">7. Использование Информации</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">7.1. Если Вы подписались на Нашу электронную рассылку, то переданная Вами Личная Информация будет использована для ответа на Ваши запросы, отправки Вам пресс-релизов, информационных объявлений общего характера и другой информации о Нас или Наших продуктах, а также с целью улучшения качества предоставляемых Нами услуг. Наши покупатели могут отказаться от получения информации об обновлениях продуктов в любое время. Вы сможете отказаться от Наших рассылок в нижней части каждого электронного письма, которое Мы отправим Вам.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">7.2. Если Вы не давали согласие на получение Наших рассылок, то Мы не будем с Вами связываться, за исключением случаев, когда по какой-либо причине Мы не сможем обработать заказ, который Вы разместили через Сайт. В подобных случаях Мы можем связаться с Вами, чтобы запросить дополнительную информацию или уточнить уже имеющиеся данные для завершения обработки Вашего заказа.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">7.3. В процессе предоставления Наших услуг Мы можем раскрыть Вашу Личную Информацию сторонним поставщикам. Мы также можем использовать Вашу Личную Информацию, чтобы информировать Вас об изменениях и обновлениях Сайта, в случае если вы не отказались от подобных рассылок.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">7.4. Мы может создавать записи Анонимной Информации из Личной Информации, исключив данные (например, Ваше имя) – вариант обобщённая статистика, которые являются устанавливающими Вашу личность. Мы можем использовать данную Анонимную Информация для анализа структуры запросов и использования наших продуктов, чтобы улучшить качество наших продуктов и услуг. Мы оставляем за собой право использовать и раскрывать Анонимную Информацию третьей стороне по Нашему усмотрению, в том числе для внутреннего бизнес-анализа и предоставления совокупных демографических данных Нашим партнерам.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">8. Личная Информация, собранная в процессе совершения заказов</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">8.1. Если вы приобрели какие-либо продукты через Наш Сайт, то на Вас может распространяться действие дополнительных положений и условий продажи и/или лицензий, в рамках которых Вы имеете право использовать любое программное обеспечение, встроенные в подобные продукты, если таковое имеется. Эти дополнительные положения и условия регулируют Ваши права на подобные продукты и в отношении оных.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">9. Отзывы</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">9.1. Если Вы оставляете отзывы на Сайте, то Мы можем использовать их в любых целях, при условии, что Мы не будем ассоциировать отзыв с Вашей Личной Информацией. Мы будем собирать любую информацию, содержащуюся в подобных сообщениях и использовать Личную Информацию, содержащуюся в подобных сообщениях, в соответствии с настоящей Политикой Конфиденциальности.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">10. Раскрытие Личной Информации</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">10.1. За исключением случаев, предусмотренных Политикой Конфиденциальности, Мы не раскрываем Вашу Личную Информацию третьим лицам. Мы также не раскрываем информацию о счетах без Вашего ведома.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">10.2. Однако Мы можем сообщить Вашу Личную Информацию третьим лицам для обработки платежей или для того, чтобы предоставить Вам доступ на Сайт. Данные лица обязуются не использовать Вашу Личную Информацию в целях, отличных от предоставления запрошенных нами услуг, и связаны соглашениями о неразглашении конфиденциальной информации. Вы даете свое согласие на передачу Вашей Личной Информации Нашим подрядчикам и сторонним поставщикам для предоставления Вам наших продуктов и услуг.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">10.3. В будущем у нас могут появиться компания-учредитель, дочерние предприятия, совместные предприятия и другие связанные с Нами компании (было: компании под общим с нами управлением) (все вместе – &quot;Связанные Структуры&quot;). На данный момент Мы не раскрываем Вашу Личную Информацию Нашим Связанным Структурам, но если в будущем Мы раскроем Вашу Личную Информацию (частично или полностью) данным Связанным Структурам, то Мы обеспечим соблюдение ими настоящей Политики Конфиденциальности.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">10.4. Если Наша компания или Наши активы приобретет другая компания, она становится владельцем собранной Нами Личной Информации и принимает на себя права и обязательства в отношении Вашей Личной Информации, описанные в настоящей Политике Конфиденциальности.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">10.5. Вне зависимости от выбора, который Вы сделаете в отношении Вашей Личной Информации (как описано далее), Мы можем раскрыть Вашу Личную Информацию (1) если посчитаем, что подобное раскрытие необходимо для (а) соблюдения соответствующих законов или ответа на постановления суда, или (б) для защиты Наших или сторонних прав или собственности; или (2) в связи с расследованием и предотвращением мошенничества.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">11. Ваш выбор в отношении использования Вашей Личной Информации</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">11.1. Мы предлагаем Вам выбор в отношении сбора, использования и передачи Вашей Личной Информации. У Вас будет возможность отказаться от Нашей рекламной рассылки, когда Вы будете приобретать продукты через Сайт и/или Приложение. Вы можете отказаться от нашей дальнейшей рассылки, а также получите возможность &quot;отказаться&quot;, следуя инструкциям по отмене подписки, содержащимся в полученном Вами электронном письме, или предоставляемых Нами путем прямого контакта (см. контактную информацию далее). Вне зависимости от Ваших предпочтений в отношении электронной почты, Мы может посылать Вам уведомления об обновлении Нашей Политики Безопасности.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">12. В отношении детей</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">12.1. Мы не занимаемся целенаправленным сбором Личной Информации о посетителях, не достигших 13-летнего возраста.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">13. Другие сайты</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">13.1. Ссылки на любой другой веб-сайт или страницу предоставляются Нами исключительно для Вашего удобства и не служат показателем нашей поддержки другого веб-сайта, страницы или ее содержания. Мы не контролируем, не проверяем и не несем ответственность за эти веб-сайты и их содержание. Пожалуйста, помните, что условия Нашей Политики Конфиденциальности неприменимы к сторонним веб-сайтам.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">14. Безопасность</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">14.1. Мы прилагаем коммерчески оправданные усилия для защиты Вашей Личной Информации, используя технологии и методы обеспечения безопасности, отвечающие современным стандартам индустрии, чтобы помочь сохранить Вашу Личную Информацию от несанкционированного доступа, использования или раскрытия. Мы обеспечиваем безопасность данных, которые Вы посылаете Нам физическими и электронными процессами и процессами управления. Мы настоятельно рекомендуем Вам соблюдать все меры предосторожности для защиты Вашей Личной Информации во время работы в Интернете. Одним из возможных способов защиты - использование безопасного браузера. Наш коммерческий сайт использует SSL-шифрование, отвечающее современным стандартам индустрии, на всех коммерческих веб-страницах, где используется Ваша Личная Информация. В качестве дополнительной меры предосторожности, убедитесь, что Вы используете последнюю версию браузера с поддержкой SSL. Мы рекомендуем использовать Internet Explorer 9, Chrome 11, Firefox 6, Opera 15, Android 4, Safari 5.1.4. Это поможет лучше защитить конфиденциальность Вашей Личной Информации во время работы в Интернете.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">14.2. За исключением особых случаев, предусмотренных настоящей Политикой Безопасности, Мы предоставляем доступ к Личной Информации, хранящейся в наших электронных базах, только представителям Нашей организации (включая сотрудников и подрядчиков), которым он требуется для выполнения рабочих обязанностей.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">14.3. Мы принимаем все возможные меры, чтобы защитить Вашу Личную информацию от перехвата, доступа, использования или раскрытия несанкционированными лицами, однако Мы не можем полностью исключить все угрозы, связанные с безопасностью Вашей Личной Информацией.</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">15. Обновления Политики Конфиденциальности</span></p><p style=\"margin-top: 0px; margin-bottom: 20px; white-space: normal; font-family: Ubuntu, Arial, Helvetica, sans-serif; padding: 0px; color: rgb(136, 136, 136); font-size: 13px; line-height: 20px; background-color: rgb(255, 255, 255);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">15.1. Настоящая Политика Конфиденциальности может подвергнуться изменениям в любой момент по Нашему единоличному усмотрению. Мы оповестим Вас об изменениях в настоящей Политике Конфиденциальности по предоставленному Вами адресу электронной почты, а также разместим любые изменения Политики Конфиденциальности на Сайте. Тем не менее, мы рекомендуем Вам перечитывать настоящую Политику Безопасности каждый раз, когда вы используете Наш веб-сайт на тот случай, если вы пропустили изменения в Политике Безопасности. Если Вы не согласны с какими-либо изменениями, Вы должны немедленно прекратить использование Сайта и/или Приложения. Использование Сайта после оповещения о любых подобных изменениях будет воспринято как принятие Вами подобных изменений и согласие со всеми положениями и условиями подобных изменений.</span></p><p style=\"white-space: normal;\"><br/></p><p><br/></p>', '', '', '', '2016-10-23 02:38:04', '2016-10-23 07:02:20');
