INSERT INTO `storefooterinfomultilanguage` VALUES ('287', '69', '7', 'Доставка', '<p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;\"><strong>Мы доставляем в Россию и </strong><strong>другие </strong><strong>страны. </strong><strong>999OWN</strong><strong>&nbsp;предлагает три варианта доставки:</strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;\"><strong><br/></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial; font-size: 15px;\">Авто+Авиа</span></strong><span style=\"font-family: Arial; font-size: 15px;\">&nbsp;(автомобильный путь и авиамаршрут). Ваш груз автомобильным транспортом, после завершения экспортных процедур на таможне Китая, доставляется до границы и проходит таможенную очистку. Затем он поступает к авиаперевозчику, и Вы получаете свой заказ в аэропорту назначения (Пример: срок доставки до Москвы – 10-15 дней).</span></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><span style=\"font-family: Arial; font-size: 15px;\"><br/></span></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial; font-size: 15px;\">Авто+ж/д</span></strong><span style=\"font-family: Arial; font-size: 15px;\">&nbsp;(автомобильный путь и железная дорога). Грузовой автомобиль доставляет сборный груз до границы после прохождения экспортных процедур на территории КНР. Затем производится таможенная очистка, и груз передается транспортным компаниям, осуществляющим доставку по железным дорогам по территории России и стран СНГ. Вы получаете свой заказ на терминале транспортной компании. (Пример: срок доставки до Москвы – 20-25 дней).</span></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><span style=\"font-family: Arial; font-size: 15px;\"><br/></span></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial; font-size: 15px;\">Море.</span></strong><span style=\"font-family: Arial; font-size: 15px;\">&nbsp;Ваш груз в контейнере автомобильным транспортом доставляется до порта отгрузки и загружается на морское судно, и после завершения экспортных процедур судно идет до порта Российской Федерации, где проходит таможенную очистку. Затем товар отправляется в пункт назначения железнодорожным транспортом. (Пример: срок доставки до Москвы – 45-60 дней).</span></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial; font-size: 15px;\">Внимание!&nbsp;</span></strong><span style=\"font-family: Arial; font-size: 15px;\">При планировании обязательно учитывайте, что срок консолидации сборного груза по территории Китая после выкупа товаров составляет от 5 и более дней, и зависит от количества поставщиков.</span></span></p><p><br/></p>', '', '', '', '2016-10-23 03:28:59', '2016-10-25 00:51:10');
