INSERT INTO `storefooterinfomultilanguage` VALUES ('367', '77', '7', 'Дропшиппинг', '<p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;\"><strong>Схема сотрудничества по дропшиппинг</strong></span></p><p><img src=\"upload/image/20161025/1477355997262012196.png\" title=\"1477355997262012196.png\" alt=\"图片1.png\"/></p><p><br/></p><p><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Интернет магазин 999OWN.RU приглашает к дропшиппинг сотрудничеству всех, кто желает начать зарабатывать или расширить свой бизнес в интернет продажах, при этом вкладывая всего лишь свое время.</span></strong></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Система организации работы в виде прямой доставки (дропшиппинга) предельно простая:&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">1 покупатель заказывает у вас товар</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">2 покупатель платит вам</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">3 вы получаете процент и заказываете у нас товар на адрес покупателя (тут ваша работа заканчивается)</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4 мы обрабатываем заказ и отправляем заказ напрямую вашему покупателю</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Сразу же представим Вам ряд преимуществ, которые в кратчайшие сроки выведут вас на достойный уровень:</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• вы не предварительно вкладываете деньги в товар</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• вы не платите за аренду склада</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• вы не тратите деньги на упаковочные материалы (скотч,пленка,картонные ящики)&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• вы не платите зарплату кладовщикам и грузчикам</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• вы не тратите время, нервы и деньги на оформлением ТТН (товарно транспортных накладных)</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• вы не тратите время и деньги на поездку к перевозчику для отправки заказов</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Вам остается только отвечать на звонки, принимать заказы и заказать их у нас.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Все остальное мы делаем за вас!</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Мы гарантируем качество товара. Каждая вещь перед отправкой тщательно осматривается на отсутствие браков. Существует обмен и возврат на протяжении 14 дней от даты заказа (при условии что товар не использовался).</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">МЫ</span></strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"> создадим для Вас все условия чтобы Вы смогли начать зарабатывать:</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">― Мы откроем Вам доступ к нашим товарам для загрузки на ваш сайт (товары представлены с актуальной ценой, характеристиками, картинками, все организовано по группам)</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">― Мы сами отправим товар вашему клиенту</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">― Мы предлагаем вам бонусную систему, то вы сэкономите более денег</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">ВЫ </span></strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">всего лишь:</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">― Загружаете наши товары к себе на сайт</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">― Заказываете заказы у нас</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">― Отправляем товар вашему клиенту, получаете Номер Декларации (ТТН) и отправляете ее клиенту</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">― Зарабатываете деньги и радуетесь сотрудничеству с нами&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Сотрудничая с нами, Вы сможете получить доступ к товару по самым низким ценам (оптовым ценам), что позволит Вам самост</span></p><p><br/></p>', '', '', '', '2016-10-23 03:46:44', '2016-10-25 00:41:52');
INSERT INTO `storefooterinfomultilanguage` VALUES ('368', '77', '8', 'Дропшиппинг', '<p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\"><strong>Схема сотрудничества по дропшиппинг</strong></span></p><p style=\"white-space: normal;\"><img src=\"http://www.888own.com/upload/image/20161025/1477355997262012196.png\" title=\"1477355997262012196.png\" alt=\"图片1.png\"/></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Интернет магазин 999OWN.RU приглашает к дропшиппинг сотрудничеству всех, кто желает начать зарабатывать или расширить свой бизнес в интернет продажах, при этом вкладывая всего лишь свое время.</span></strong></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Система организации работы в виде прямой доставки (дропшиппинга) предельно простая:&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">1 покупатель заказывает у вас товар</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">2 покупатель платит вам</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">3 вы получаете процент и заказываете у нас товар на адрес покупателя (тут ваша работа заканчивается)</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4 мы обрабатываем заказ и отправляем заказ напрямую вашему покупателю</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p style=\"whi