INSERT INTO `storefooterinfomultilanguage` VALUES ('387', '79', '7', 'Гарантии', '<p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(227, 108, 9);\"><strong><span style=\"background-image: initial; background-attachment: initial; background-color: rgb(255, 255, 255); background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Ваше доверие превыше всего!&nbsp;</span></strong></span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(29, 27, 16); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\"><strong><span style=\"background-image: initial; background-attachment: initial; background-color: rgb(255, 255, 255); background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><br/></span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-size: 16px; background: rgb(255, 255, 0);\"></span></strong>Именно поэтому компания&nbsp;999OWN&nbsp;стремиться к созданию лучшей платформы электронной торговли по работе с Китаем.&nbsp;999OWN.RU — удобная и безопасная площадка. Мы создали все условия для успешной работы.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><br/></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial;\">К</span></strong><strong><span style=\"font-family: Arial;\">ачественное исполнение всех этапов заявки</span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial;\"><br/></span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">999OWN.RU&nbsp;гарантирует качественное исполнение всех этапов заявки – от закупки до доставки. Проверка&nbsp;товара, перевозка по Китаю&nbsp;и&nbsp;до границы&nbsp;Вашей страны, доставка до города получателя – все лежит на плечах&nbsp;999OWN.RU. Компания несет финансовую ответственность за каждую проведенную сделку.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial;\">П</span></strong><strong><span style=\"font-family: Arial;\">ровер</span></strong><strong><span style=\"font-family: Arial;\">ка</span></strong><strong><span style=\"font-family: Arial;\">&nbsp;информаци</span></strong><strong><span style=\"font-family: Arial;\">и</span></strong><strong><span style=\"font-family: Arial;\">&nbsp;о</span></strong><strong><span style=\"font-family: Arial; color: rgb(255, 0, 0);\">&nbsp;<span style=\"color: rgb(12, 12, 12);\">производителе</span></span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial; color: rgb(255, 0, 0);\"><span style=\"color: rgb(12, 12, 12);\"><br/></span></span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">все ли у него в порядке с документами и как отзываются о нем покупатели из Китая. При необходимости проверяются налоговые сведения.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><br/></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial;\">Проверка&nbsp;</span></strong><strong><span style=\"font-family: Arial;\">качеств</span></strong><strong><span style=\"font-family: Arial;\">а</span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial;\"><br/></span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Мы ценим время наших клиентов, поэтому весь товар проходит обязательную ручную проверку качества.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><br/></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Наши эксперты оценивают более 20 параметров каждого изделия. Отслеживается не только правильность изготовления вещи (ровность швов, степень проклейки, работоспособность молний и застежек и др.) и отсутствие дефектов, но и соответствие характерных элементов марки (кроя, фирменных знаков и элементов, бирки и т.д.). Дополнительно проверяется размерность заказанных товаров, целостность упаковки.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Мы берем на себя полную ответственность за продукцию. Если вы получите от нас товар ненадлежащего качества, мы гарантируем бесплатную замену товара или возврат денег без проволочек и сложностей.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial;\">З</span></strong><strong><span style=\"font-family: Arial;\">ащита тары</span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: Arial;\"><br/></span></strong></span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">999OWN.RU&nbsp;предлагает решения по защите тары, что позволяет минимизировать риск воровства при перевозке.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p style=\"white-space: normal;\"><br/></p><p><br/></p>', '', '', '', '2016-10-23 03:50:07', '2016-10-23 08:49:33');
