INSERT INTO `storefooterinfomultilanguage` VALUES ('397', '80', '7', 'Условия возврата', '<p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;;\">Условия возврата&nbsp;</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Основным условием возврата товара является обнаружение брака или ненадлежащего качества поставляемая продукция.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Возврати обмен товара производится только целой коробкой, а не отдельными парами.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">В случае обнаружения брака, в процессе приемки товара, Покупатель обязан в течение&nbsp;2-х&nbsp;дней&nbsp;известить об этом Продавца в письменной форме. В течение&nbsp;1-2 рабочих дней,&nbsp;после рассмотрения претензии, Продавец предоставит ответ.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Товары участвующие в акциях и распродажах обмену и возврату не подлежат.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">1. Порядок извещения Продавца&nbsp;в&nbsp;спорных ситуациях, при оформлении претензий или возврата, Покупателю необходимо:&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">1.1 Сделать качественный снимок брака или товара в неудовлетворительном состоянии, ставшем причиной претензии.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><span style=\"font-family: Arial; font-size: 15px;\">1.2 Выслать сделанные фото с описанием проблемы в электронном виде региональному менеджеру либо по адресу: </span><span style=\"font-family: Arial; font-size: 15px; color: rgb(227, 108, 9);\">info@999own.ru</span></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;2. Документация для оформления возвратаВ случае обнаружения брака Покупатель обязан оформить следующие документы:2.1 Акт, составленный по форме № ТОРГ-2, утвержденной&nbsp;постановление Госкомстата РФ от 25.12.1998 г. № 132.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;&nbsp;2.2 Товарно-транспортная накладная Покупателя на возврат.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">2.3 Заявка на возврат (образец)</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">2.4 Направить их в адрес Продавца.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">2.5 Если между Продавцом и Покупателем возникнут разногласия о характере выявленных дефектов и причинах их возникновения, то для определения качества продукции Покупатель проводит экспертизу,&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">для оформления заключения о браке.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Если причиной брака является заводской брак, то мы сделаем возврат.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Если брак возник по вине покупателя, то такие возвраты не принимаются.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">3. Требования к состоянию возвращаемого товара</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;3.1 Возвращаемый некачественный товар должен быть:</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• чистым</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• в фирменной первичной упаковке без нанесения маркировки Покупателя на обувь и коробки</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• иметь все комплектующие.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">3.2 Не является браком нестандартное оформление текстуры товара (неровности, шероховатости, расположение цветов на товаре), в том числе нестандартная форма и порядок &nbsp;оформления &nbsp;соединений&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">(соединение на клею, соединение термическим способом, нестандартная геометрия шва и др.).</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;3.3 Возвратный товар должен быть отправлен в течение суток.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4.&nbsp;Порядок возврата денежных средств</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4.1 В случае положительного решения возможно 2 варианта возврата:</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;• Переведенная Вами ранее сумма может быть использована в качестве&nbsp;оплаты за следующие заказы.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;• Мы оформим возврат денежных средств на Ваш расчетный счет.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4.2 &nbsp;Денежные средства будут возвращены на расчетный счет в течение&nbsp;3&nbsp;рабочих дней с момента поступления возврата в офис компании.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><br/></p>', '', '', '', '2016-10-23 03:51:12', '2016-10-25 00:57:29');
