рака является заводской брак, то мы сделаем возврат.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">Если брак возник по вине покупателя, то такие возвраты не принимаются.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">3. Требования к состоянию возвращаемого товара</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;3.1 Возвращаемый некачественный товар должен быть:</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• чистым</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• в фирменной первичной упаковке без нанесения маркировки Покупателя на обувь и коробки</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">• иметь все комплектующие.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">3.2 Не является браком нестандартное оформление текстуры товара (неровности, шероховатости, расположение цветов на товаре), в том числе нестандартная форма и порядок &nbsp;оформления &nbsp;соединений&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">(соединение на клею, соединение термическим способом, нестандартная геометрия шва и др.).</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;3.3 Возвратный товар должен быть отправлен в течение суток.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4.&nbsp;Порядок возврата денежных средств</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4.1 В случае положительного решения возможно 2 варианта возврата:</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;• Переведенная Вами ранее сумма может быть использована в качестве&nbsp;оплаты за следующие заказы.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;• Мы оформим возврат денежных средств на Ваш расчетный счет.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4.2 &nbsp;Денежные средства будут возвращены на расчетный счет в течение&nbsp;3&nbsp;рабочих дней с момента поступления возврата в офис компании.</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p style=\"white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><br/></span></p><p><br/></p>', '', '', '', '2016-10-23 03:51:12', '2016-10-25 00:57:26');
