INSERT INTO `storefooterinfomultilanguage` VALUES ('408', '81', '8', 'Вопрос и ответ', '<h3><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px; color: rgb(227, 108, 9);\">1. Вопросы о товарах</span></h3><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px; color: rgb(227, 108, 9);\"><br/></span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">1) Как искать товар?</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0); background: white;\">Искать товары на нашем сайте можно с помощью каталога и фильтров (цена, категория, производитель, цвет, размер). А также вы можете воспользоваться строкой поиска в верхней части сайта.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; background: white;\">2) Как выбрать товары по коробками, по парами или поштучно?</span></strong></span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; background: white;\"><br/></span></strong></span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; background: white;\"><img src=\"upload/image/20161030/1477840961140085124.png\" title=\"1477840961140085124.png\" alt=\"7.png\" width=\"786\" height=\"592\" style=\"width: 786px; height: 592px;\"/></span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(63, 63, 63); background: white;\"><br/></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(63, 63, 63);\"></span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"color: rgb(63, 63, 63); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">3) Если не нашли понравившихся товаров, можно ли помогать искать товары?</span></strong><strong><span style=\"color: rgb(63, 63, 63); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"></span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Если Вы не можете найти товар на нашем сайте, то можно связаться с нами по почте </span><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; text-decoration: none; color: rgb(227, 108, 9);\">info@999own.ru</span><span style=\"text-decoration: none; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 112, 192);\">.&nbsp;</span><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Мы помогаем вам найти хороших поставщиков.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"><br/></span></p><p><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px; color: rgb(227, 108, 9);\">2. Вопросы о заказах</span></strong></p><p><br/></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; background: white;\">1) Как сделать заказ?</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0); background: white;\">Чтобы ознакомиться с процессом оформления заказа, нажмите пожалуйста </span><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0); text-decoration: underline; background: white;\"><a href=\"http://www.999own.ru/common/footer/orderhelp.jsp?id=67\" target=\"_blank\" title=\"Как сделать заказ?\">по этой ссылке</a>.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0); background: white;\">&nbsp;</span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; background-color: rgb(255, 255, 255);\">2)&nbsp;</span>Какая у вас минимальная сумма заказа?</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0); background: white;\">Минимальная сумма заказа: 20 000 руб.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0); background: white;\">&nbsp;</span></p><p><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(63, 63, 63);\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; background-color: rgb(255, 255, 255);\">3)&nbsp;</span>Какое минимальное количество оптовой партии?</span></strong></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Все категории товаров на платформе предлагаются оптом, <span style=\"font-size: 14px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(12, 12, 12);\">поштучно или сборными упаковками</span><span style=\"font-size: 14px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: red;\"> </span>по несколько штук. Чтобы посмотреть, какие товары продаются оптом упаковками, а какие поштучно, используйте фильтры на нашем сайте, кроме того, на странице каждого товара четко написано “продается пошучно или упаковками”и “минимальное количество оптовой партии”.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"><br/></span></p><p><span style=\"color: rgb(227, 108, 9);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;\">3. Вопросы об оплате</span></strong></span></p><p><br/></p><p style=\";margin-bottom:0\"><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">1) Какие способы оплаты?</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Способы оплаты:</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-size: 14px; font-family: Arial, sans-serif;\">Банковские карты (Visa,&nbsp;Master</span> <span style=\"color: rgb(0, 0, 0); font-size: 14px; font-family: Arial, sans-serif;\">Card)</span></span></p><p style=\"margin-bottom:4px;line-height:20px\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">PayPal</span></p><p style=\"margin-bottom:4px;line-height:20px\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Western Union</span></p><p style=\"margin-bottom:4px;line-height:20px\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Wire Transfers&nbsp;</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Яндекс.Деньги</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"><br/></span></p><p><span style=\"text-decoration: none; color: rgb(12, 12, 12); font-size: 14px; font-family: Arial, sans-serif;\">Чтобы подробнее, нажмите </span><span style=\"text-decoration: underline; color: rgb(12, 12, 12); font-size: 14px; font-family: Arial, sans-serif;\"><a href=\"http://www.999own.ru/common/footer/payment.jsp?id=68\" target=\"_blank\" title=\"Оплата\">по этой ссылке</a>.</span></p><p><br/></p><p><span style=\"color: rgb(227, 108, 9);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;\">4. Вопросы о доставке</span></strong></span></p><p><span style=\"color: rgb(227, 108, 9);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;\"><br/></span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"></span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">1) Какая сфера доставки?</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"><span style=\"color: rgb(0, 0, 0); font-size: 14px; font-family: Arial, sans-serif;\">Доставку по миру. Доставка в любой регион России, а также в другие</span> <span style=\"color: rgb(0, 0, 0); font-size: 14px; font-family: Arial, sans-serif;\">стараны</span><span style=\"color: rgb(0, 0, 0); font-size: 14px; font-family: Arial, sans-serif;\">.&nbsp; </span></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\"><span style=\"font-size: 14px; font-family: Arial, sans-serif;\">2) Бесплатная</span> <span style=\"font-size: 14px; font-family: Arial, sans-serif;\">доставка?</span></span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Внимание: На нашем сайте отсутствуют товары с бесплатной доставкой, Вы сами должны платить доставку вашего заказа. </span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">3) Какие способы доставки? Сколько будет стоить доставка? Какой срок доставки?</span></strong></span><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"> </span></p><p><span style=\"color: rgb(12, 12, 12); font-size: 14px; font-family: Arial, sans-serif;\">Способы доставки: Авто+Авиа, Авто+ж/д, Море. Чтобы подробнее, нажмите </span><span style=\"color: rgb(12, 12, 12); font-size: 14px; font-family: Arial, sans-serif; text-decoration: underline;\"><a href=\"http://www.999own.ru/common/footer/delivery.jsp?id=69\" target=\"_blank\" title=\"Доставка\">по этой ссылке</a>.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(12, 12, 12);\">Стоимость доставки зависит от веса заказа и способа доставки.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(12, 12, 12);\">Срок доставки зависит от способа доставки.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"><br/></span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">4) Откуда груз отправится?</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Из Китая в любой регион России, а также в другие стараны.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">&nbsp;</span></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">5) Срок выполнения заказа в днях?</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Отправка заказа осуществляется в течение 3 рабочих дней после поступления денег на счет.</span></p><p><br/></p><p><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">6) Есть ли самовывоз?</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Нет самовывоза. Потому что до сих пор все товары в Китае. Зато если вы именно в Китае, то Вы&nbsp;можете&nbsp;самостоятельно забрать ваш заказ из пункта&nbsp;самовывоза по Китаю.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"><br/></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"></span></p><p style=\"white-space: normal;\"><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">7) Проверяется ли заказ перед отгрузкой товара?</span></strong></span></p><p style=\"margin-bottom: 0px; white-space: normal;\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Перед отгрузкой мы тщательно проверяем каждый товар.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"><br/></span></p><p><span style=\"color: rgb(227, 108, 9);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px;\">5. Вопросы о послепродажном обслуживании</span></strong></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"><br/></span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\"></span></p><p style=\";margin-bottom:0\"><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">1) Есть ли возможность обмена товара?</span></strong></span></p><p style=\";margin-bottom:0\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Есть возможность, но без проблемы по качеству, Вы должны нести расходы за обратную транспортировку товара.</span></p><p style=\";margin-bottom:0\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">&nbsp;</span></p><p style=\";margin-bottom:0\"><span style=\"color: rgb(63, 63, 63);\"><strong><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px;\">2) Есть ли возможность возврата товара?</span></strong></span></p><p style=\";margin-bottom:0\"><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; color: rgb(0, 0, 0);\">Есть возможность. Если есть проблемы по качеству или порче в пути (транспортировка), мы несем расходы за обратную транспортировку товара. Если без проблем по качеству или порче в пути, Вы несете расходы за обратную транспортировку товара и предыдущую транспортировку.</span></p><p><span style=\"font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 16px; color: rgb(0, 0, 0);\"><br/><br/></span></p>', '', '', '', '2016-10-23 03:51:40', '2016-10-30 15:30:58');
